import React from 'react'
import { Outlet, Navigate } from 'react-router-dom'
const ProtectedRoutes = ({isLogged}) => {
  if (isLogged) {
    return <Outlet/>
  }else{
    return <Navigate to="/singin"/>
    }
}

export default ProtectedRoutes
